import React from "react";
import Cards from "./Cards";
import Sdata from "./Sdata";


const Netfilx = () =>{
    return(
        <Cards 
        key= {Sdata[2].id}
        imgsrc= {Sdata[2].imgscr}
        title= {Sdata[2].title}
        sname= {Sdata[2].sname}
        link= {Sdata[2].links}
    />
    );
};

export default Netfilx;
